INSERT INTO `trinity_string` VALUES (542137, '|cfff00000[Events announcement]:|r Rift to Stromgard available in Dalaran.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r Разлом в Стромгард открыт в Даларане.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542138, '|cfff00000[Events announcement]:|r Commander Payne looking for volunteers in Dalaran.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r В Даларане проходит набор добровольцев для оказания помощи в Ущелье Песни Войны.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542139, '|cfff00000[Events announcement]:|r Treasure search in the Stranglethorn jungle is started. You can join it.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r В Северной Тернистой долине начались поиски сокровищ. Присоединяйся, если хочешь испытать себя.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542140, '|cfff00000[Events announcement]:|r Congratulations! We have a first one who find treasure in Stranglethorn jungle. First place: %s', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r Поздравляем! У нас есть первый кто нашел сокровища в Северной Тернистой долине. Первое место занимает: %s.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542141, '|cfff00000[Events announcement]:|r Congratulations! We have a second one who find treasure in Stranglethorn jungle. Second place: %s', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r Поздравляем! У нас есть второй кто нашел сокровища в Северной Тернистой долине. Второе место занимает: %s.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542142, '|cfff00000[Events announcement]:|r Congratulations! We have a third one who find treasure in Stranglethorn jungle. Third place: %s', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r Поздравляем! У нас есть третий кто нашел сокровища в Северной Тернистой долине. Третье место занимает: %s.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542143, '|cfff00000[Events announcement]:|r The Crossroads in Nothern barrens and Sentinel hill in Westfall was attacked by Legion.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Ивент-оповещение]:|r Перекресток в Северных степях и Сторожевой холм в Западном крае были атакованы Легионом.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542144, '|cfff00000[Information. SPP Server]:|r Gold coin of valor: you can get these coins by special quests and server events. Decency points: when you get bans you get 1 decency point. Each one decency point reduce count of gained Gold coin of valor. 1 decency point = 10% reduce gained Gold coins of valor. Maximum reduce is 50%. Decency is activated when this bonus system is release on live servers, so you get decency points by bans also only after release. How you can remove decency point from your character? Is no way right now. Prices in vendor: all prices can change at any time and later will be balanced and calculate by count of daily quests etc.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Информация. Бонусы проекта. v1.01]:|r Золотая монета доблести: вы можете получить эти монеты за особые задания и события. Порядочность: за каждый новый бан вы будете получать 1 отрицательный балл порядочности. Каждый отрицательный балл будет уменьшать количество получаемых Золотых монет доблести. 1 балл = 10% уменьшения получаемых монет. Максимальное уменьшение - 50%. Порядочность будет активирована после появления данной системы на игровых мирах, соответственно отрицальные баллы будут получены только за новые баны после активации данной системы. Как я могу уменьшить отрицательные баллы? В данный момент никак. Цены у вендора: Цены могут быть изменены в любое время и позже будут балансироваться в зависимости от количества доступных бонусных квестов, событий и т.д.', NULL, NULL);
INSERT INTO `trinity_string` VALUES (542145, '|cfff00000[Information. Support in Warsong]:|r Take a %s and find injured fighters on battleground. When you find injured fighter take him and go back on your base. Use vehicle abilities for attack, defence and take a fighters. For each one saved injured fighter you receive 1 stack of bonus aura. When you finish save event go to Commanders Payne table and use it for exchange 1 stack of bonus aura for 1 Gold coins of valor.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '|cfff00000[Информация. Помощь в Ущелье Песни Войны.]:|r Берите %s и найдите раненых бойцов своей фракции. Когда найдете раненого бойца, подберите его и возвращайтесь на базу к лекарям. Используйте способности транспорта для атаки, защиты и спасения бойцов. За каждого спасенного бойца вы будете получать 1 стак бонусной ауры. Когда завершите спасение бойцов, возвращайтесь к столу командующего Пэйна и используйте его для обмена 1 стака ауры на 1 золотую монету доблести.', NULL, NULL);
