INSERT INTO `trinity_string` VALUES (600030, 'You are not mounted or incorrect mount! Please sit on mount for recomplete criteria for that mount and try again.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Вы не на маунте или некорректный маунт! Пожалуйста, сядьте на маунта для которого вы хотите перезасчитать достижение или критерию и повторите операцию.', NULL, NULL);
