INSERT INTO `trinity_string` VALUES (600225, 'Help: You also can recomplete achievement which need to learn some spells. For example: achievement \"Why? Beacause its red\", you need to find source mount spell for this mount. For thist mount source spell is 26054. So you need to enter this ID in \"enter achieve ID\" string. ALSO you can recomplete criterias where need to collect pets. For example: achieve \"Celestial Family\", you need to find NPC ID of source pet. Example: NPC ID for \"Zao, Calfling of Niuzao\" is 72464. So you need to enter this ID in achieve string. ALSO you can recomplete criterias where need to each skill level of professions. For example: \"Skill to pay the bills\", you need to enter special ID of profession in \"enter achieve id\" string. Spectial IDs: 10000 - for Fishing, First aid, Cooking and Archaeology. [INFORMATION & FUNCTIONS of this NPC can be improved and edit if it needed or possibly]', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Помощь: По мимо перезасчитывания ачив, вы также можете засчитать критерии где необходимо изучить какое либо заклинание. Пример: достижение \"Почему? Потому что он красный\". Вам нужно найти спелл призыва этого маунта(на wowhead.com). Например у него он будет - 26054, следовательно вам необходимо ввести этот ID в поле \"введите id достижения. ТАКЖЕ вы можете засчитать критерии где необходимо получить боевого питомца. Пример: ачив \"Небесное семейство\", вам необходимо найти ID NPC питомца. К примеру у \"Зао, теленок Нюцзао\" NPC ID - 72464. Этот ид необходимо ввести в поле \"введите ид достижения\". ТАКЖЕ вы можете засчитать критерии где необходимо повысить уровень навыка профессии. Например: ачив \"На все руки от скуки\", вем необходимо ввести специальный ID профессии. Спец IDs: 10000 - для Рыбной ловли, Первой помощи, Кулинарии и Археологии. [ИНФОРМАЦИЯ И ВОЗМОЖНОСТИ у НПЦ при необходимости/возможности будут расширяться]', NULL, NULL);
